DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `RecalcularPuntuaciones` ()   BEGIN
    -- Calcular la media de las valoraciones y actualizar la puntuación de cada usuario
    UPDATE trabajadores t
    SET t.puntuacion = (
        SELECT AVG(puntuacion)
        FROM puntuaciones p
        WHERE p.id_trabajador = t.id_usuario
    );
END$$

DELIMITER ;

