(134, 12, 12, 'Hola, buenos días. Estoy teniendo problemas con el fregadero de mi cocina, ¿podrías ayudarme?', '2024-08-30 17:26:49'),
(135, 13, 12, '¡Hola, buenos días! Claro, estaré encantado de ayudarte. ¿Qué tipo de problema estás experimentando con tu fregadero?', '2024-08-30 17:27:00'),
(136, 12, 12, 'Pues parece que está atascado. El agua no fluye como debería y cada vez que uso el fregadero, se llena rápidamente.', '2024-08-30 17:27:10'),
(137, 13, 12, 'Entiendo. ¿Has notado algún olor extraño o sonido inusual cuando intentas usarlo?', '2024-08-30 17:27:22'),
(138, 12, 12, 'Sí, a veces huele mal y hace un ruido burbujeante cuando el agua se acumula.', '2024-08-30 17:27:32'),
(139, 13, 12, 'Eso suena a que hay un atasco en la tubería. Podría ser debido a residuos acumulados. ¿Cuándo fue la última vez que limpiaste la tubería o usaste algún desatascador químico?', '2024-08-30 17:27:42'),
(140, 12, 12, 'La verdad, hace mucho que no lo limpiamos y nunca hemos usado un desatascador químico.', '2024-08-30 17:27:51'),
(141, 13, 12, 'Bien, en ese caso, te recomendaría que primero intentes usar un desatascador químico para ver si puede disolver el atasco. Si eso no funciona, necesitaré pasar por tu casa para hacer una limpieza más profunda de la tubería.', '2024-08-30 17:28:01'),
(142, 12, 12, 'De acuerdo, intentaré con el desatascador químico. Si no funciona, ¿cuándo podrías venir?', '2024-08-30 17:28:07'),
(143, 13, 12, 'Puedo pasar mañana por la mañana si te va bien. ¿Alrededor de las 10?', '2024-08-30 17:28:29'),
(144, 12, 12, 'Perfecto, mañana a las 10 me viene genial. Gracias por la ayuda.', '2024-08-30 17:28:39'),
(145, 13, 12, '¡De nada! Nos vemos mañana entonces. No dudes en contactarme si necesitas más ayuda antes de la cita.', '2024-08-30 17:28:51'),
(146, 12, 15, 'Buenas tardes, estaria interesado en contratar sus servicios ', '2024-08-30 18:02:24'),
(147, 13, 12, 'Ha sido un placer hacer negocios contigo', '2024-08-30 18:04:02');

